import React from 'react';
import './Video.css'

const Video = () => {
    return (
        <div className='video'>
            <div class="container">
                <div class="text" data-msg="CSS&nbsp;Animation">
                    <div class="text--content">
                        <div class="text--data">Wellocome&nbsp;to Yugi</div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Video;
